import React, {Fragment, Component } from 'react'
import { Pie, defaults } from 'react-chartjs-2'

export class adminBarChart extends Component {
  render() {
    return (
    <Fragment>
      <Pie
        height={400}
        width={600}
        options={{
          maintainAspectRatio: false,
          scales: {
            yAxes: [
              {
                ticks: {
                  beginAtZero: true,
                },
              },
            ],
          },
          legend: {
            labels: {
              fontSize: 25,
            },
          },
        }}
      />
    </Fragment>    
    )
  }
}

export default adminBarChart
